import React, { Component } from "react";

class F extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="">
        <ul>
          <li>My Password is not working , what to do ?</li>
          <li>Send email on Contact Us section on Website</li>
        </ul>
      </div>
    );
  }
}

export default F;
